  const ClickHandler = () => {
    setTitle(" mohanraj");
        console.log('clicked');
    }
    return(
    <Card className="expense-item">
      <div>
       <Expensdate date={props.date}></Expensdate>
      </div>
        <div className="expense-item__description">
            <h2>{title}</h2>
            <div className="expense-item__price">
                ${props.amount}
            </div>
        </div>
        <button >Title change</button>
    </Card>
    
    )
}

